import React, { useState, useEffect } from 'react'

function View1() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/view1").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            <h1>This is the View 1 page</h1>
            <p>{data.Greeting}</p>
            <p>{data.Message}</p>
        </div>
    )
}

export default View1;
